(45, 'terribell0701@gmail.com', 'USA', 'Please Select', 'Please Select', '', 'Jobs', 'Work From Home', 'Sales', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			Benefit Specialist/Recruiter needed:</p>\r\n		<p>\r\n			Our growing company is looking for highly motivated individuals to work as a Benefit Specialist and as a Recruiter.&nbsp; Positions involve being on the phone the majority of the time.&nbsp; This is a telecommuting position where you would be working out of your residential office.&nbsp; You can work part or full time!&nbsp; We provide complete training for the right individual.&nbsp; Health Plans are included for you and your family.&nbsp; If you are interested please fill out an application at: <a href="http://www.freedomathometeam.com/terribell">www.freedomathometeam.com/terribell</a></p>\r\n	</body>\r\n</html>\r\n', '', 'Telecommuter', '863-382-9359', 42, 1000000, 'Free', '10-05-2013'),
