(71, 'aparajayah3@gmail.com', 'India', 'Tamil Nadu', 'Please Select', 'Indian Bank Colony  New Natham Road', 'Services', 'Computer - Web Services', 'Seo services', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			Search Engine Optimization (SEO):<br />\r\n			***************************<br />\r\n			<br />\r\n			Search engine optimization is a methodology followed by all web developing companies to get the website rank higher in search engine. All client rank higher in search engine. All clients would love to have their website to display on top in search engine, when user search for the products and services. Seo helps the search engine recognize your relevance to the specific keywords that people mostly search online. The search engine optimization process involves researching keywords, Creating content, Building links and make sure your website display visibility in the search engine.<br />\r\n			<br />\r\n			We have experts analyzing the client website and optimize for their choice of keywords. And our team will get to understand your business goals and objectives and work hard in depth towards your aim to complete with your competitors, which will let you overcome your business obstacles easily and get you to the success in short period of time.<br />\r\n			<br />\r\n			<br />\r\n			SEO Services:<br />\r\n			***********<br />\r\n			<br />\r\n			Aparajayah Technologies Pvt Ltd strongly believes that an internet is undoubtedly the biggest contemporary way to gather information about anything under the sun. Internet marketing, in fact, is the cheapest and the most effective way to promote ones product or service on a global scale.<br />\r\n			We have SEO packages segregated to make the client understand what they want exactly to get their website top ranked ,also to enable our team to figure out the exact requirement of the client customer and get to their target, which enhance them to achieve their goal too.<br />\r\n			<br />\r\n			SEO service Packages we provide:<br />\r\n			<br />\r\n			1.&nbsp; Starter Package<br />\r\n			2.&nbsp; Intermediate Package<br />\r\n			3.&nbsp; Advanced Package<br />\r\n			4.&nbsp; Professional Package<br />\r\n			5.&nbsp; Enterprise Package<br />\r\n			<br />\r\n			According to the choice of the client customer, we render the support and service under the package the client choose.<br />\r\n			<br />\r\n			1.&nbsp; Starter Package: In this SEO package the service is provided for 3 months to enhance the client website.<br />\r\n			2.&nbsp; Intermediate Package: In this SEO package the service is provided for 6 months to enhance the client website.<br />\r\n			3.&nbsp; Advanced Package: In this SEO package the service is provided for 8 months to enhance the client website.<br />\r\n			4.&nbsp; Professional Package: In this SEO package the service is provided for 10 months to enhance the client website.<br />\r\n			5.&nbsp; Enterprise Package: In this SEO package the service is provided for 12 months to enhance the client website.<br />\r\n			&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n			Mostly our clients are advised to choose the Intermediate Seo Service Package as we believe that it has appropriate time period to make the client website visible enough&nbsp; in their growing stage. We provide the choice to choose or extend the packages as per their satisfaction and business requirement.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			<strong>http://www.aparajayah.com/internet_marketing</strong><br />\r\n			&nbsp;</p>\r\n	</body>\r\n</html>\r\n', '7.jpg', 'seo,search engine optimization,seo service, seo company, seo companies,internet marketing, social media optimization', '', 72, 1000000, 'Free', '30-05-2013'),
