(104, 'lavishkhan9718@gmail.com', 'India', 'National Capital Territory of Delhi', 'Please Select', 'nehru place', 'Home-Lifestyle', 'Clothing - Garments - Watches', 'daaze', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			Adhwani Textile Pvt. Ltd, located in TirupurTamilnadu, India &nbsp;are the exclusive licensees of DAAZE&reg; brand &nbsp;International Inc. (USA) for manufacture and distribution of the DAAZE&reg; brand Innerwear/Leisurewear for Men and Women in India, Sri Lanka, Bangladesh, Nepal, Afghanistan, UAE.</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			Adhwani Textile Pvt. Ltd, located in TirupurTamilnadu, India is the manufacture and distribution of the DAAZE&reg; brand Innerwear for Men and Women that is international brand of Adhwani Textile Pvt. Ltd.</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			Adhwani Textile Pvt. Ltd, a group company of Adhwani Group, is one of the fastest growing companies in India. Incorporated in the year 1965 under the visionary and able leadership of Mr. O. P. Adhwani</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			Head Quartered at New&nbsp;<a class="wikilinks" href="http://stateofdelhi.olx.in/" style="box-sizing: border-box; border-width: 0px 0px 1px; border-bottom-style: dotted; border-bottom-color: black; outline: 0px; font-style: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px; color: rgb(80, 80, 80); text-decoration: none;">delhi</a>, the company is equipped with young and efficient team, which constantly work towards offering unmatched and high quality service, with cost effective and tailor made solutions for every business and individual requirement.</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			Adhwani Textile Pvt. Ltd was set up in 1965 and since then company is making undergarment and&nbsp;<a class="wikilinks" href="http://www.olx.in/q/jeans/c-217" style="box-sizing: border-box; border-width: 0px 0px 1px; border-bottom-style: dotted; border-bottom-color: black; outline: 0px; font-style: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px; color: rgb(80, 80, 80); text-decoration: none;">jeans</a>, T-shirt,&nbsp;<a class="wikilinks" href="http://www.olx.in/q/shirt/c-217" style="box-sizing: border-box; border-width: 0px 0px 1px; border-bottom-style: dotted; border-bottom-color: black; outline: 0px; font-style: inherit; font-family: inherit; vertical-align: baseline; margin: 0px; padding: 0px; color: rgb(80, 80, 80); text-decoration: none;">shirt</a>, trousers for man and women .Adhwani Textile Pvt. Ltd identified the need of good quality undergarments then it introduced a wide range of quality products of undergarments in the name of DAAZE &reg; for men and women.</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			In India Company started operations in 1965 with the manufacturing, distribution and marketing. Company&rsquo;s workforce numbered 5000 people with manufacturing operations spread over fifteen plants in Tirupur. Adhwani Textile Pvt. Ltd commands wide spread pan India distribution in 500 cities.</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			DAAZE products includes Vest, Brief, Shorts and Apparel. DAAZE brand is now available in 3500 stores all over the world. DAAZE is the number one brand and product choice for young people around the world.</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			DAAZE &reg; is a Californian most popular brand.</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			Warehousing and Customer Care Centre provides customer with:</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Broader selection of products</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Superior buying experience</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; On-time delivery of products</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Quick resolution of any concerns</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			BENEFITS OF ASSOCIATION WITH DAAZE INTERNATIONAL</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			1. WIDE Distribution and no healthy competition in the market.</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			2. SPECIALTY and exhaustive product line with higher margins and greater effectiveness.</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			3. PREMIER Packaging symbolizing quality and offering remarkable shelf presence</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			4. STACKABLE products result in higher profitability per customer</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			5. REMARKABLE support from DAAZE in regards to product training, marketing, and market Development.</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			6. Perfect and suitable Marketing Plan for promoting the brand in the individual Franchise markets.</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			7. Young, Vibrant and Efficient Sales force for ensuring the availability of products in the market.</p>\r\n		<p style="box-sizing: border-box; border: 0px; outline: 0px; font-size: 13px; font-family: arial, helvetica, sans-serif; vertical-align: baseline; margin: 0px; padding: 20px 0px 0px; line-height: 20px; clear: left; background-color: rgb(255, 255, 255);">\r\n			8. Sharing the salaries of the Franchisee sales force.</p>\r\n	</body>\r\n</html>\r\n', 'daaze-international_1.jpg', 'daaze', '9371346111', 89, 1000000, 'Free', '07-06-2013'),
(105, 'mariselaetsitty@hotmail.com', 'Australia', 'Please Select', 'Please Select', 'mariselaetsitty@hotmail.com', 'Services', 'Business Offers', 'Some Best Fundraising Ideas', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			Youth is considered as the back bone of any nation. It can be manipulated in many positive ways that ultimately will bring a peaceful change across the globe. Regarding the fundraising programs, youth is again considered as a dominant factor. There are various <span id="docs-internal-guid-3677093d-23f6-6ba0-f1da-f5a3184a9834" style="font-size:15px;font-family:Calibri;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;">&lt;a href=&quot;http://www.wofunding.com/&quot;&gt;best fundraising ideas&lt;/a&gt;</span> especially for youth which can make them enable to collect large amount of funds within no time. These funds can be served for different causes. Obviously, youth is full of enthusiasm and any they can remove any type of obstacle that comes in their way that would try to make them stop. One of the <strong>best fundraising ideas</strong> is to opt for the sale of a product. A product should be chosen after a thorough investigation of whether it would be an appealing item to the audience or not. &nbsp;&nbsp; &nbsp;<br />\r\n			<strong>Krispy Kreme Fundraising Idea:</strong><br />\r\n			Who on the earth would not like to have a piece of donut at least once in a day? This could be the most hilarious <strong>fundraising idea</strong> because everybody loves to eat Krispy Kreme donuts. One of the major drawbacks of practicing this idea is that it would not generate large amount of funds when it comes among the ladies. Of course, ladies are way conscious about their figure, looks and weight and they probably would not love to have it on daily basis. But at the same time, men would love these donuts every day. They are usually not conscious about their weight like women.<br />\r\n			<strong>Candle Fundraisers:</strong><br />\r\n			Candles are treated as a special product in almost every function. Regardless of whether you are attending marriage ceremonies, birthday parties, burial ceremony or whatever is the reason of people gathering; you will definitely find candles at each and every occasion. In view of that, candle fundraisers programs can be organized and people would love to buy bunch of candles at nominal charges. They might give you bonus when they&rsquo;ll come to know about the fundraising program through candles but the matter of fact is that candle fundraiser is one of the most effective ideas of today. Especially in Christmas season, you can collect more than expected amount of funds within no time.<br />\r\n			<strong>Discount Coupons:</strong><br />\r\n			Another effective idea of collecting funds is to sell discount coupons. This will surely attract a large number of audiences towards yummy discount deals. There are few things that are to be investigated before getting into any sort of action. Make sure, the discount coupons that you are selling must be of well-known shops where most of the people love to shop in local town. Secondly, only offer discount coupons on daily based things like food, fruits, utensils, and beverages. People would love to eat at discounted price especially when it is being offered on the name of <span id="docs-internal-guid-3677093d-23f6-6ba0-f1da-f5a3184a9834" style="font-size:15px;font-family:Calibri;color:#000000;background-color:transparent;font-weight:normal;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;">&lt;a href=&quot;http://www.wofunding.com/&quot;&gt;best fundraising ideas&lt;/a&gt; </span>.&nbsp; In addition to it, keep some giant discount coupons along with you and offer them to the people who you think would go for a bigger shot while shopping. These discounts can be awarded on the purchase of different appliances like television, refrigerators, deep freezers and so on.</p>\r\n	</body>\r\n</html>\r\n', 'wofun.jpg', 'crowd funding china, best crowdfunding sites ,best fundraising ideas', '45465575', 91, 1000000, 'Free', '08-06-2013'),
