er Packs of 500 Wp, 750 Wp, 1000 Wp,1500 Wp, 2000 Wp &amp; 3000 Wp. </em></em></div>\r\n		<div>\r\n			<em>&nbsp;</em></div>\r\n		<div>\r\n			<em><em>1Kwp &amp; 2Kwp &amp; 3Kwp &amp; 4Kwp ..... 100Kwp.. ect........</em></em></div>\r\n		<div>\r\n			<br />\r\n			<br />\r\n			<em><em>Our modules are certified with IEC 61215 Ed.2, IEC 61730, and IEC 61701 by TUV Rheinland.<br />\r\n			<br />\r\n			We are an ISO 9001 certified company by TUV Germany.<br />\r\n			<br />\r\n			At present we are manufacturing solar modules starting from 3 Wp to 310 Wp, and taking up EPC for commercial projects.<br />\r\n			<br />\r\n			Herewith we have enclosed the data sheet for your ready reference.<br />\r\n			<br />\r\n			We can provide you customized solutions to meet your exact requirements.</em></em><br />\r\n			&nbsp;</div>\r\n	</body>\r\n</html>\r\n', '10 Wp Solar Panel Module.jpg', '''Solar Panel'', ''Solar Module'', ''Solar 10W Panel'', ''Solar'', ''Energy'' ', '9894230307', 107, 1000000, 'Free', '17-06-2013'),
