(146, 'gillsir25@gmail.com', 'India', 'Gujarat', 'Ahmedabad', 'Gill Sir, Opp Maninagar Fire Station, Below ING Bank,Krishnabaug, Maninagar-380008', 'Education-Learning', 'Coaching - Tuitions', 'GILL SIR - Spoken English, IELTS, TOEFL, GRE, SAT, CMAT,CAT, Study Visa/PR', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			Gill Sir is one of the leading education institutes located in Maninagar. Ahmedabad. The Gill Sir is well-known for its coaching and training method in Maninagar area and among the people of Ahmedabad. Gill Sir is also known for its contribution done in the field of coaching classes due to many reasons. We provide students with all the requirements for educating themselves. Our main branch is in Maninagar.</p>\r\n		<p>\r\n			Gill Sir&rsquo;s Spoken English Class.</p>\r\n		<p>\r\n			Spoken English- Gill Sir provides you Spoken English Course at our branch in Maninagar, Ahmedabad. Gill Sir is a reputed Spoken English Class for learning English and is a hub for teaching of English language as it maintains best English teaching and has extraordinary English faculty and English Speaking material. Gill Sir gives you a very good environment for learning English language and provides you Spoken English best course in Maninagar, Ahmedabad.</p>\r\n		<p>\r\n			Gill Sir&rsquo;s IELTS Coaching.</p>\r\n		<p>\r\n			IELTS- IELTS coaching is done best only at Gill Sir. IELTS coaching at Gill Sir is done is a very systematic and focused manner. Gill Sir takes the student step by step in understanding IELTS and its nuances.&nbsp;&nbsp;In our IELTS coaching classes we pay attentions to all the modules of reading, writing, listening and speaking. Many of our IELTS students have received 7-8.5 bands in the IELTS exam. Gill Sir provides the best training for the IELTS in the whole city and Gill Sir gives you the assurance of best coaching and facilities for the IELTS training.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			Gill Sir&rsquo;s TOEFL Coaching Center.</p>\r\n		<p>\r\n			TOEFL- Gill Sir offers you the best TOEFL training in Ahmedabad. Gill Sir&rsquo;s TOEFL training is perfected in its online module and offers and very good TOEFL training schedule. Our TOEFL training is helpful to all the aspirants of U.S.A and also offers quick TOEFL exam preparation.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			Gill Sir&rsquo;s GRE Coaching Classes.</p>\r\n		<p>\r\n			GRE- Gill Sir provides methodical coaching for GRE and provides all the required notes and material for the GRE exam. Gill Sir carefully takes note of the ETS methods, rules and regulation, etc. Gill Sir offers the proper computer based training for the GRE test and prepares you for the new GRE with all the required resources, materials and books.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			Gill Sir&rsquo;s M.B.A. Entrance preparation</p>\r\n		<p>\r\n			M.B.A. Entrance &ndash; Gill Sir offers very special training for the M.B.A. entrance test and M.B.A. exams. We offer training for CAT, CMAT, MAT, GMAT and preparation for M.C.A entrance tests. Gill Sir also offers classes for GMAT for the M.B.A. entrance and for admission in foreign universities.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			CAT Coaching Class/Center- Gill Sir supports the CAT students with its par excellence CAT coaching. Gill Sir realizes the fact that many students today aspire to go to the IIM&rsquo;s and Gill Sir awakens them to the goal of the M.B.A and CAT as the main stream method to realize the dream of M.B.A.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			SAT Coaching- Gill Sir provides you the best SAT coaching and equips the students with all the materials, books, CD&rsquo;s, etc for the SAT exam. Gill Sir is one of the best coaching institutes for the SAT exam preparation coaching.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			CMAT Coaching Class- Gill Sir offers excellent coaching for CMAT and covers all the important parts of Verbal/English, Reasoning, Maths/Quant, etc for the CMAT. Gill Sir prepares the CMAT students for winning the competitive edge at the CMAT exam</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			Gill Sir&rsquo;s Study Visa Services.</p>\r\n		<p>\r\n			Study Visa Services- Gill Sir is also a hub for study visa services in Maninagar across Ahmedabad. Gujarat. Our study visa services offer free consultation to students and gives them free study visa assessment.&nbsp;&nbsp;Gill Sir helps in admission and visa assistance for the countries like USA, Canada, Australia, New Zealand and UK. Gill Sir helps students to get admission in foreign colleges and helps them obtain study visa for the mentioned countries like USA, Canada, Australia, New Zealand, etc. Inspired by developed expertise for visa assistance Gill Sir gives you an unfailing way to study abroad and increases your chances to settle in a foreign country.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			Gill Sir offers help in Foreign Education</p>\r\n		<p>\r\n			Admission in Foreign Colleges and Universities- Gill Sir provides you services for admission in foreign universities and colleges. The best part is that Gill Sir does not charge students for its study visa services and offers them visa assistance in an appropriate and exact manner.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			Gill Sir&rsquo;s Assistance in Study Abroad Programs.</p>\r\n		<p>\r\n			Study Abroad Programs- Gill Sir offers you complete assistance and guidance in study abroad programs. Gill helps you in getting planned interviews; filing documents, study visa application, etc.&nbsp;&nbsp;&nbsp;</p>\r\n		<p>\r\n			Gill Sir offers PR Assistance/Help for &ndash; Canada, USA, New Zealand, Australia and UK. Gill Sir provides a clear cut and transparent process for the PR Visa process for the mentioned countires like Canada, USA, New Zealand, Australia, UK and Australia. Gill Sir supports the applicants throughout the process and helps in doing a perfect fool proof PR visa process.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			Gill Sir&rsquo;s Computer Training Academy.</p>\r\n		<p>\r\n			Computer Course and Computer training- Gill Sir offers classes for basic computers , internet, Google, ms office, power point, excel, PowerPoint, Tally, Windows, Linux, Software and Hardware training, preparation for computer exams, etc.</p>\r\n		<p>\r\n			Computer Training Center- Gill Sir has a perfected computer training center for the students who want to get trained in computers and achieve their goal. Gill Sir believes that today there is a great need for computer literacy and due to this motto Gill Sir has started computer training centers.</p>\r\n		<p>\r\n			Gill Sir&rsquo;s Mira Tuition Classes.</p>\r\n		<p>\r\n			Mira Tution Class in Isanpur helps young students to develop their skills in various subjects in the fields of commerce and science. The Mira Tution Class provides coaching to students from STD 1<sup>ST</sup>&nbsp;to 12<sup>th</sup>. Proper tuition and guidance is done under the supervision of Poonam Madam. Poonam Madam takes care of all the activities pertaining to teaching of students of Mira Tuition Class. The Mira Tution Class is offering expert classes for the student up to STD 10<sup>th</sup>. English, Social Studies, Maths and Science are given due attention at Mira Tuition Class at its Isanpur branch.</p>\r\n	</body>\r\n</html>\r\n', 'gill sir logo.by gill sir.jpg', 'Spoken English, IELTS, GRE, SAT, CAT, Study Visa,,CMAT,TOEFL, Spoken English in Maninagar, English Speaking, English Speaking in Maninagar, IELTS in Maninagar, CMAT coaching classes, CMAT  in Maninagar, CAT in Maninagar, CAT coaching class,GRE in Maninagar, TOEFL in Maninagar, TOEFL Coaching Classes, SAT Coaching Classes, Study Visa, Study Visa in Maninagar, Permanent Residency, Permanent Residency Consultation in Maninagar, Visa Consultants, Study Visa Consultants,  IELTS 7 bands, Computer Cour', '9327699618', 111, 1000000, 'Free', '20-06-2013'),
