(270, 'nisagentwb671@gmail.com', 'India', 'Tripura', 'Please Select', 'ARUNDHUTINAGAR, West Tripura, Agartala', 'Electronics-Technology', 'Mobile - Mobile Accessories', 'Nokia Lumia 920', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			Nokia Lumia 920 is the new flagship device from Nokia which runs on Microsoft Windows Phone 8 operating system and is carved out of a uni-color polycarbonate block which gives it a very rich and premium feel. Nokia Lumia 920 features a 4.5 inch Pure Motion HD+ IPS display with a resolution of 1280 &times; 768 pixels and a density of 332 pixels per inch which makes the pictures and texts look crisp. The screen of the phone is also protected from Corning Gorilla Glass 2 which keeps it safe from unwanted scratches. The device works with a 1.5 GHz dual-core Qualcomm MSM8960 Snapdragon Krait processor, and an Adreno 225 GPU. It also comes with 1GB of RAM, 32GB internal storage capacity and 7GB of free space on Sky Drive. This Smartphone was announced back in September 2012 but saw its first release on 2nd November 2012 in some countries. For further details please visit http://www.homeshopsiliguri.com.Posted id (nisagentwb671@gmail.com).</p>\r\n	</body>\r\n</html>\r\n', 'nokia-lumia-920.jpg', '', '919933418292', 173, 1000000, 'Free', '08-07-2013'),
