(274, 'innovativepharmacy.in@gmail.com', 'India', 'Uttar Pradesh', 'Please Select', 'PLOT NO. 6, KNOWLEDGE PARK - II GREATER NOIDA UTTAR PRADESH', 'Education-Learning', 'Other', 'Innovative institute of Law Delhi, Noida, Greater Noida Law College offers Degree Courses ', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			Innovative law College - Law College offers two courses in law: (i) Three years Ll.B.(H) and (ii) Five year B.A. Ll.B. integrated law degree course. courses is independent of the other and is in accordance with the rules laid down by the C.C.S. University Meerut and the Bar Council of India. And benefit of Five Year Course&nbsp; B.A. LL.B&nbsp;Five Years&#39; Integrated Course has been adopted with the objective of saving one full year of students who are keen to become law graduates. After successful completion of first two years, a degree of B.A. (Law) is awarded and thereafter three years are devoted to obtain of law as against a total of six years. Thus saving one full year</p>\r\n	</body>\r\n</html>\r\n', 'banner-4.jpg', 'Law College, Legal Education, innovative law college delhi, B.A Ll.B. a 5-year integrated course, 3 years LLB, law institute delhi, Noida, Institute of Law, excellence in legal education, law college Greater Noida, NCR Delhi', '8800200051', 180, 1000000, 'Free', '12-07-2013'),
(275, 'info@stratinsol.com', 'India', 'Maharashtra', 'New Bombay ', 'S block,APMC DANA MARKET,Sector 19,Vashi', 'Services', 'Business Offers', 'Virtual Office in Navi mumbai', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			<style type="text/css">\r\n<!--\r\n		@page { margin: 2cm }\r\n		H2 { margin-bottom: 0.21cm }\r\n		H2.cjk { font-family: "WenQuanYi Micro Hei" }\r\n		H2.ctl { font-family: "Lohit Hindi" }\r\n		P { margin-bottom: 0.21cm }\r\n	-->			</style>\r\n		</p>\r\n		<p style="margin-bottom: 0cm">\r\n			<b>Live receptionist service</b></p>\r\n		<p style="margin-bottom: 0cm">\r\n			&nbsp;</p>\r\n		<p style="font-weight: normal">\r\n			Your virtual receptionist team, much like a virtual assistant, answers each call with a personalized greeting, screens and transfers all your calls directly to you based on a schedule that you control. The online receptionist can also schedule your appointments, make outbound calls, answer customer service questions, process orders and handle a wide range of administrative tasks.<br />\r\n			<br />\r\n			<font size="3"><b>Call Forwarding/ Screening</b></font></p>\r\n		<p>\r\n			With Stratinsol&#39;s call screening and call forwarding service, each of your telephone calls is screened and routed by a friendly live receptionist to any employee in your company or to any phone number of your choice, business or personal.</p>\r\n		<p>\r\n			<font size="3"><b>Appointment Scheduling</b></font></p>\r\n		<p>\r\n			With Stratinsol&rsquo;s appointment scheduling, you will never miss another appointment again.</p>\r\n		<p>\r\n			<br />\r\n			<font size="3"><b>Order Processing &amp; Customer Service</b></font></p>\r\n		<p>\r\n			Your Stratinsol Live Receptionist team can place orders and process payments through your web based commerce system with Stratinsol&rsquo;s order processing services. Not only can your team of virtual assistants place orders, they answer technical support questions and provide order processing customer service for your business.</p>\r\n		<p>\r\n			<br />\r\n			<b>Outbound Calling</b></p>\r\n		<p>\r\n			This outbound calling service includes:</p>\r\n		<ul>\r\n			<li>\r\n				<p style="margin-bottom: 0cm">\r\n					Lead Generation</p>\r\n			</li>\r\n			<li>\r\n				<p style="margin-bottom: 0cm">\r\n					Outbound Appointment Scheduling</p>\r\n			</li>\r\n			<li>\r\n				<p style="margin-bottom: 0cm">\r\n					Follow up calls</p>\r\n			</li>\r\n			<li>\r\n				<p style="margin-bottom: 0cm">\r\n					Surveys &amp; Market Research</p>\r\n			</li>\r\n			<li>\r\n				<p style="margin-bottom: 0cm">\r\n					Subscription Renewals &amp; Sales</p>\r\n			</li>\r\n			<li>\r\n				<p>\r\n					Third Party Verification Services</p>\r\n			</li>\r\n		</ul>\r\n		<p>\r\n			All outbound calling is carried out by professional virtual personal assistants; trained on specifics of your business.</p>\r\n		<h2 class="western">\r\n			<font size="3"><b>Toll Free and Local Numbers</b></font></h2>\r\n		<p>\r\n			With Stratinsol Virtual Toll Free numbers you can offer customers an easily recognizable way to reach you. . In addition to the virtual office telephone system, Davinci also offers virtual office rental and virtual office tools too.</p>\r\n		<h2 class="western">\r\n			<font size="3"><b>Advanced Call Routing</b></font></h2>\r\n		<p>\r\n			Call routing allows callers to reach you through a dedicated number, no matter where you are. This call routing service ensures that you no longer have to communicate your schedule to clients and colleagues &ndash; simply activate our find me/ follow me feature to start intelligent call routing and eliminate the worry of missing an important call.</p>\r\n		<p>\r\n			<br />\r\n			&nbsp;</p>\r\n		<p>\r\n			<br />\r\n			&nbsp;</p>\r\n		<p>\r\n			<br />\r\n			&nbsp;</p>\r\n		<p>\r\n			<font size="3"><b>Auto Receptionist</b></font></p>\r\n		<p>\r\n			Stratinsol&#39;s Auto Receptionist puts you in control of all your communication needs. Our full-featured communications tool answers your calls with a professionally recorded greeting and then routes them to you wherever you are to fit your personal schedule.<br />\r\n			<br />\r\n			&nbsp;</p>\r\n		<p>\r\n			<font size="3"><b>Audio Conferencing</b></font></p>\r\n		<p>\r\n			Stratinsol Virtual Audio/Video Conference Phone Service offers crystal clear phone conferencing for you and your customers / associates. Conference calling can be initiated by simply dialing into your Stratinsol Virtual Account and entering the Conference Center.</p>\r\n		<h2 class="western">\r\n			<font size="3"><b>Live Web Chat</b></font></h2>\r\n		<p>\r\n			Our live representatives engage your web visitors into a &quot;Live Web Chat&quot; session as they are viewing your business website.<br />\r\n			These web chat services also send relevant chat info to your cell phone immediately and/or email you instantly for follow up.</p>\r\n		<h2 class="western">\r\n			<font size="3"><b>MEETING ROOMS</b></font></h2>\r\n		<p style="font-weight: normal">\r\n			Fully furnished meeting rooms and boardrooms, all fully IT equipped with video conferencing equipment and teleconferencing equipment providing the perfect corporate setting for conducting business in tech-savvy India.</p>\r\n		<h2 class="western">\r\n			<font size="3"><b>Live Virtual Assistant</b></font></h2>\r\n		<p style="font-weight: normal">\r\n			Stratinsol Virtual Assistant Services Are the Solution for Your Growing Business</p>\r\n		<p style="margin-bottom: 0cm">\r\n			&nbsp;</p>\r\n		<p style="margin-bottom: 0cm">\r\n			<font size="3"><b>Communications Services</b></font></p>\r\n		<p style="margin-bottom: 0cm">\r\n			&nbsp;</p>\r\n		<p>\r\n			<font size="3"><b><strong>Remote Receptionist: </strong></b><span style="font-weight: normal">STRATINSOL offers</span><strong><span style="font-weight: normal"> </span></strong><span style="font-weight: normal">a lineup of extremely proficient recruits capable of using technologically advanced Computer-Telephone Integration of Software. This way our clients can work remotely to replace the role of a traditional receptionist</span></font></p>\r\n		<div dir="LTR" id="stcpDiv">\r\n			<p align="JUSTIFY">\r\n				<strong>Answering services</strong>: STRATINSOL provides a dedicated number to the customer and arranges for the answering of their calls by knowledgeable, well-practiced and specialized employees. The communication received is then passed on to the respective client. This way our client companies can eliminate the need for voice mail</p>\r\n			<p>\r\n				<br />\r\n				&nbsp;</p>\r\n			<p style="margin-bottom: 0cm">\r\n				<a name="stcpDiv"></a><b>Space services</b></p>\r\n		</div>\r\n		<p style="margin-bottom: 0cm">\r\n			&nbsp;</p>\r\n		<p style="margin-bottom: 0cm">\r\n			<b><strong><font size="3">Professional Address</font></strong><font size="3">:&nbsp; </font></b><font size="3"><span style="font-weight: normal">STRATINSOL provides a prominent building as the business address. This can be of immense assistance for home-based business endeavors, as it aids them take advantage of the privacy and personal security of their home, whi</span></font></p>\r\n	</body>\r\n</html>\r\n', '', 'cse,virtual office,bpo,navi mumbai,vashi', '9820359397', 182, 1000000, 'Free', '12-07-2013'),
