(362, 'leadindiamediagroup@gmail.com', 'India', 'National Capital Territory of Delhi', 'Please Select', 'Lead India Group, D-58, Laxmi Nagar, Vikas Marg', 'Community', 'Charity - Donate - NGO', 'Lead India Publishers association (LIPA)', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			What is Lead India Publishers Association (LIPA)?</p>\r\n		<p>\r\n			&nbsp;Like other developing sectors and industries newspapers too faced numerous complicated and tough problems after independence. A news paper is established in the interest of masses.</p>\r\n		<p>\r\n			The foremost motive of the publisher is to raise issues of public; but in this tiring process of bringing up public voice a publisher finds his own getting suppressed. It is true especially for the publishers who are novice in the field and circulation of their newspaper is not large either.</p>\r\n		<p>\r\n			&nbsp;They are always assessed for their reputation and circulation instead of work. But, work is the same whether a news paper publishes single copy or tens of thousands. There is no change in the outlook and purpose of the publisher, then why is there a bias against publishers or newspapers with comparatively lower circulation.</p>\r\n		<p>\r\n			&nbsp; The biggest hurdle before newspaper publishers is economical. Only source of earning for a newspaper is advertisements. But, the parameters of giving government ads is such that to fulfill them it&rsquo;s imperative to earn goodwill of concerned officers or there is no other way than to play with circulation figures.</p>\r\n		<p>\r\n			&nbsp;On the other hand, at times publisher don&rsquo;t get respect in his own community because of rank and file. Publisher faces all the slur and obstruction alone because they are working in different units. While, they are at ease while talking of civic welfare, they do get uneasy when it comes to their own issues; and they don&rsquo;t even have a platform to raise their own voice.</p>\r\n		<p>\r\n			&nbsp;Today, there is a kind of encouragement for job generating businesses and establishments dedicated to social well-being. But, catastrophe with newspapers is that in spite of being a kind of social organization neither do they get government or non-government boosting nor any monetary aid. Even if they manage to get some corporate help question marks are raised about their compatibility to voice issues of social good.</p>\r\n		<p>\r\n			&nbsp;The aid given by government in the form of advertisements proves to be a tall tale. But, the irony is such that there are double parameters even in that.</p>\r\n		<p>\r\n			&nbsp;Till struggling newspapers are given due weight they will keep fighting to salvage their foundation which will take away fairly good proportion of their energy.</p>\r\n		<p>\r\n			&nbsp;This is why &lsquo;Lead India Publishers Association&rsquo; (LIPA) has been instituted to bring them together over a single platform.</p>\r\n		<p>\r\n			<strong>Definition of LIPA</strong></p>\r\n		<p>\r\n			&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Lead India Publishers Association (LIPA) is a Non Governmental Organization. LIPA established to unite newspaper publisher at one stage.</p>\r\n		<p>\r\n			<strong>Initiatives</strong></p>\r\n		<p>\r\n			&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Lead India Publishers Association (LIPA) is an initiative of Mr. Subhash Singh with his highly talented team.</p>\r\n		<p>\r\n			<strong>Registration:</strong></p>\r\n		<p>\r\n			&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &#39;Lead India Publishers Association registered&#39; under the Society Registration Act, 1860. Registration no. is District East/Society/89/2010.</p>\r\n		<p>\r\n			<strong>Operation Area:-</strong></p>\r\n		<p>\r\n			&bull;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; All over India</p>\r\n	</body>\r\n</html>\r\n', 'lipa_1.jpg', 'newspaper association, lipa association, publishers association, lead india, lead india group, media association, journalist association, help for journalist', '9990892816', 237, 1000000, 'Free', '05-08-2013'),
