ug discovery to Submission</div>\r\n		<div>\r\n			Clinical Research Organization / Contract Research Organization</div>\r\n		<div>\r\n			Basics of clinical research and Pharmacovigilance</div>\r\n		<div>\r\n			Scope of the Pharmacovigilance</div>\r\n		<div>\r\n			Pharmacovigilance Process</div>\r\n		<div>\r\n			Pharmacovigilance regulations</div>\r\n		<div>\r\n			Different types of safety reports</div>\r\n		<div>\r\n			Different phases of clinical Trials</div>\r\n		<div>\r\n			Adverse events and its types</div>\r\n		<div>\r\n			Different sources of Adverse events reporting</div>\r\n		<div>\r\n			Different types of AE reporting Forms</div>\r\n		<div>\r\n			Expedited reporting and its timelines</div>\r\n		<div>\r\n			Assessing Expectedness/Labeledness/Listedness</div>\r\n		<div>\r\n			Labeled vs. Listed</div>\r\n		<div>\r\n			Company Core Data Sheet (CCDS)</div>\r\n		<div>\r\n			Company Core Safety Information (CCSI)</div>\r\n		<div>\r\n			Assessing Expectedness/Labeledness/Listedness</div>\r\n		<div>\r\n			Labeled vs. Listed</div>\r\n		<div>\r\n			Company Core Data Sheet (CCDS)</div>\r\n		<div>\r\n			Company Core Safety Information (CCSI)</div>\r\n		<div>\r\n			Different departments working on Pharmacovigilance</div>\r\n		<div>\r\n			Roles and responsibilities of case receipt unit</div>\r\n		<div>\r\n			Four factors for the reportable case</div>\r\n		<div>\r\n			Seriousness criteria of adverse event</div>\r\n		<div>\r\n			Expectedness or Listedness of adverse event</div>\r\n		<div>\r\n			Causality assessment of the adverse event</div>\r\n		<div>\r\n			Introduction to safety databases and different types</div>\r\n		<div>\r\n			Introduction to MedDRA and WHODD</div>\r\n		<div>\r\n			Narrative writing</div>\r\n		<div>\r\n			Case quality check, Medical review and its submission.</div>\r\n		<div>\r\n			<span mce_fixed="1" mce_name="strong" mce_style="font-weight: bold;">Practical Demonstration of Oracle Argus Safety Database End user Training</span></div>\r\n		<div>\r\n		