(584, 'campuseai18@gmail.com', 'USA', 'Please Select', 'Please Select', 'Global Headquarters 1111 Superior Avenue Suite 310 Cleveland, OH 44114 USA', 'Electronics-Technology', 'Mobile - Mobile Accessories', 'College Mobile App - University Mobile App', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<h1>\r\n			myCampusMobile Apps</h1>\r\n		<p>\r\n			myCampus Mobile provides students with a variety of applications (apps) designed to make myCampus features easier than ever to access for on-the-go students, faculty and staff.</p>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			Apps available with the myCampus Mobile platform include:</p>\r\n		<table cellpadding="3" cellspacing="0" width="100%">\r\n			<tbody>\r\n				<tr>\r\n					<td valign="top" width="4%">\r\n						<strong><img align="bottom" alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=b85dd289-f5dd-40a7-b7fc-b378a845c55a&amp;groupId=212547&amp;t=1317928191898" vspace="5" width="40" /></strong></td>\r\n					<td valign="top" width="96%">\r\n						<strong>Messages &ndash;</strong> Receive targeted alerts about class cancellations, club events, weather advisories, emergency notifications and more directly from the mobile application on your phone.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=b16e8a43-75b3-4baa-b432-d7eadfb82e45&amp;groupId=212547&amp;t=1317928191871" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>Calendar &ndash;</strong> Keep better track of important university, class and extracurricular activities and events. Users can also import personal calendars that can be uploaded onto the myCampus portal and automatically integrated into the mobile calendar app.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=2dae839a-9a3e-4d6c-bfed-645dd2fa1e64&amp;groupId=212547&amp;t=1317928191902" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>News &ndash; </strong>Get the latest up-to-the minute information about what&#39;s happening on and around campus from local news sources selected by you.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=05deb97c-1cf0-4d61-adf7-494574cabdf9&amp;groupId=212547&amp;t=1317928191874" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>Dining &ndash;</strong> Check out what&#39;s on the menu at your local dining hall! The myCampus Mobile Dining app lets you browse what&#39;s for breakfast, lunch and dinner anywhere, without logging on to a traditional computer.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=9d5b32d8-7908-4345-b245-ee6272a74369&amp;groupId=212547&amp;t=1317928191897" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>Maps &ndash;</strong> Never get lost again with the myCampus Mobile Maps app. Use real map photos to find where you are, where you need to be and important physical landmarks along the way.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=c85e55d3-4319-4b34-aea2-5a75ea7e48f2&amp;groupId=212547&amp;t=1317928191869" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>Buses &ndash;</strong> Never worry that you&#39;ve missed the bus again. The myCampus Bus app lets you know when buses are on time, late or ahead of schedule without ever having to walk to the bus stop.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=814d4387-a662-4128-b9f8-7f7182909aef&amp;groupId=212547&amp;t=1317928191911" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>Videos &ndash;</strong> Post and view videos for class and entertainment right from your mobile device using the myCampus Mobile Video app.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=e60257e9-ae01-4e59-b52d-32f03a494980&amp;groupId=212547&amp;t=1317928191872" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>Classifieds &ndash;</strong> Browse and post items for sale on and around your campus from the palm of your hand.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=13d62a31-006a-47cc-a227-d4c158b03793&amp;groupId=212547&amp;t=1317928191895" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>Library &ndash;</strong> Search, browse, reserve and renew books and other materials without ever having to set foot inside the library.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=597e22e4-3431-49a5-b2f6-e1b616a6228a&amp;groupId=212547&amp;t=1317928191904" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>Parking &ndash;</strong> Keep up to date on what&#39;s going on with Parking Services at your institution. The myCampus Parking app allows you to view what parking is available when, which lots are closed and</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=16660e0a-c7a7-4f62-b250-478e0b4c17ca&amp;groupId=212547&amp;t=1317928191887" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>Directory &ndash;</strong> Your institution&#39;s student, faculty and staff directory has never been more accessible. Users can search, browse and instantly store information right onto their phones.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=ed087643-563b-4346-b1f3-9e9334bd87f8&amp;groupId=212547&amp;t=1317928191888" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>Donate &ndash;</strong> Are you in a giving mood? Check out the myCampus Donate app to instantly give to your institution without having to make a trip to the alumni association.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=2911b37c-148c-4478-a3dd-e7e687143749&amp;groupId=212547&amp;t=1317928191889" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>Emergency &ndash;</strong> Immediate access to emergency alerts is essential to the safety of your campus in this day and age. Use your mobile device to stay in the know and stay safe with the myCampus Mobile Emergency app.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=62c33fad-f1d3-4340-919f-108de7395a78&amp;groupId=212547&amp;t=1317928191891" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>Events&ndash;</strong> Want to know what&#39;s going on around campus? Keep track of all your institution&#39;s events from one app! myCampus Events will let you know where you need to be and when so you never miss an event again.</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=a04ef7fb-ccd5-455a-8208-732d9b2cb93a&amp;groupId=212547&amp;t=1317928191893" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<strong>IM &ndash;</strong> Stay connected with classmates, students and staff while on the go using the myCampus Mobile IM app, which directly links to your myCampus Portal chat feature!</td>\r\n				</tr>\r\n				<tr>\r\n					<td valign="top">\r\n						<img alt="" height="40" hspace="5" src="https://www.campuseai.org/image/image_gallery?uuid=0a4a83b9-485c-4c0d-85ab-18600f065bd2&amp;groupId=212547&amp;t=1317928191905" vspace="5" width="40" /></td>\r\n					<td valign="top">\r\n						<p>\r\n							<strong>Polls &ndash;</strong> Make your voice heard with the myCampus Polls app that allows you to view and take part in opinion polls posted on the myCampus Portal.</p>\r\n					</td>\r\n				</tr>\r\n			</tbody>\r\n		</table>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			For Learn More, Contact Here: https://www.campuseai.org/mycampus-mobile-apps</p>\r\n	</body>\r\n</html>\r\n', 'CampusEAI.JPG.jpeg', 'mobile apps, mobile app development,free mobile apps, college mobile app, university mobile app', '216.589.9626', 83, 1000000, 'Free', '04-10-2013'),
