(636, 'niservicewb0504@gmail.com', 'India', 'Tripura', 'Please Select', 'ARUNDHUTINAGAR, West Tripura, Agartala', 'Electronics-Technology', 'Mobile - Mobile Accessories', 'Nokia Lumia 510', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			Nokia&rsquo;s new Microsoft&rsquo;s Windows phone which was unveiled on 23rd September, 2012 is now available for purchase. Nokia Lumia 510 which was initially brought out with Windows Phone 7.5 operating system but later on it got Windows Phone 7.8 operating system. The new device comes with updated OS while the previous model will soon get an update although the update will not be available OTA. Features like revamped home screen and resizable Live Tiles are incorporated with the new windows. Now it can also send files over Bluetooth which was not possible earlier. Nokia Lumia 510 features a 4-inch TFT capacitive multi-touch touch screen with a resolution of 480x800 pixels and density of 233 pixels per inch. It has an 800MHz Cortex A5 single core processor with Adreno 200 graphics chip. The handset is also equipped with a Qualcomm MSM7227A Snapdragon chipset which is generally used for 3G connection. For further details please visit http://www.nationalinfoservice.org. or email us nationalinfoservice@gmail.com. Posted id (<a href="mailto:niservicewb0504@gmail.com">niservicewb0504@gmail.com</a>).</p>\r\n	</body>\r\n</html>\r\n', 'nokia-lumia2-510.jpg', 'Mobile', '09933418292', 436, 1000000, 'Free', '21-10-2013'),
