eight: 17px; background-color: rgb(255, 255, 255);" />\r\n			<br style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 17px; background-color: rgb(255, 255, 255);" />\r\n			<span style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 17px; background-color: rgb(255, 255, 255);">CEO - e Dream Holidays</span><br style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 17px; background-color: rgb(255, 255, 255);" />\r\n			<span style="color: rgb(51, 51, 51); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 17px; background-color: rgb(255, 255, 255);">Skype id : edreamholidays</span></p>\r\n	</body>\r\n</html>\r\n', 'Kalpathy car festival.jpg', 'Kalpathy Ratholsavam, Car Festival, Festival in Palakkad, World famous car festival ', '08606090890', 446, 1000000, 'Free', '12-11-2013'),
(777, 'edreamholidayspkd@gmail.com', 'India', 'Kerala', 'Palakkad (P&#257;lgh&#257;t)', '4/108, Sreekrishna, Sasthapuri, Kalpathy, Palakkad- 678003', 'Services', 'Travel Agents', 'Home stay in God''s Own Country, Palakkad', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<div class="text_exposed_root text_exposed" id="id_5281ed1cbf4128a25376137" style="display: inline;">\r\n			<span class="userContent" style="color: rgb(55, 64, 78); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 18px; background-color: rgb(255, 255, 255);"><strong>DIFFERENT REAL EXPERIENCE IN LIFE ( HOME STAY IN A MUD HOUSE)</strong><br />\r\n			<br />\r\n			Tourists travelling to the Rice Bowl of Kerala can now enjoy the luxury of traditional Palakkadan homestay at Sree Chithrakoodam. Your desire to exper<span class="text_exposed_show" style="display: inline;">ience the rich culture of Palakkad can now be fulfilled. Make your holiday memorable in a calm, eco- friendly atmosphere with glimpses of the true hues of Palakkad.<br />\r\n			<br />\r\n			Sreechithrakoodam, the ethnic homestay at Palakkad is a masterpiece by itself, an architectural marvel. Mimicking the great olden days, 90% of the structure has been build on pure mud, giving you purified air and an inflow of positive energy. The uniqueness of this mud structure is its capability of keeping the temperature of the room to an optimum level, whether it be summer or winter. The floor is completely done with red oxide, which provides a cooling effect. The roofs at the homestay are made of Bamboo and Mulbury wood, and clay tiles which have been in use in Kerala from time immemorial.<br />\r\n			<br />\r\n			The homestay has two fully furnished bedrooms with spacious attached bathrooms.&nbsp;<br />\r\n			<br />\r\n			One of the unique features of Sree Chithrakoodam is the wide veranda on all four sides, which makes your living area well aerated.</span></span></div>\r\n		<p>\r\n			<span style="color: rgb(55, 64, 78); font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 13px; line-height: 18px; background-color: rgb(255, 255, 255);">&nbsp;</span></p>\r\n	</body>\r\n</html>\r\n', 'Mud House5.jpg', 'Stay in kerala, Homely Stay in Kerala, Homely stay in Palakkad, Best Stay service in kerala', '08606090890', 446, 1000000, 'Free', '12-11-2013'),
