(784, 'sales@horizongoa.com', 'India', 'Goa', 'Panaji (Panjim, Pangim)', 'Sangolda, North Goa ', 'Real Estate', 'Apartments - For Sale', '2 / 3 BHK luxury apartments in Sangolda, North Goa ', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			<span style="font-family:times new roman,times,serif;"><strong>&quot;HORIZONS CASABLANCA&quot;,</strong>&nbsp;&nbsp;Set amidst Sangolda&#39;s lush green locales in North Goa, Casablanca promises to delight with its uniquely styled Apartments, skillfully crafted from Mediterranean and Spanish designs. Well connected to the vibrant city of Panjim and the bustling nightlife of Calangute, Casablanca brings alive the quaint sleepy village of Sangolda with its modern amenities and chic lifestyle. Adopting environmental measures, Casablanca&#39;s blueprint boasts of minimum tree-cutting and embraces a large landscape area, giving this haven the tropical touch. Backed by Horizon&#39;s highest standards of workmanship, Casablanca offers myriad luxuries and essential services like 24 hours security, elevators, a swimming pool, common sit-outs and generator backup among many others.</span></p>\r\n		<p>\r\n			<span style="font-family:times new roman,times,serif;"><strong><u>Here are a list of Amenities that makes Horizon Casablanca so Unique:</u></strong>&nbsp;&nbsp;</span></p>\r\n		<ul>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Earthquake resistant structure with T.M.T steel bars and 30cm/23cm laterite stone walls</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Teak wood door /window frames and shutters with brass ironmongery in antique finish.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">600*600 NITCO make vitrified tiles along with anti skid tiles in Common areas and Balconies.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Concealed three phase fire retardant electrical wiring of Polycab make with SSK Modular switches and adequate number of light/power/Telephone points.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">En suite fully tiled bathrooms along with high quality KOHLER fittings and sanitary ware.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">JAQUAR/DORMA make shower enclosures</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Swimming Pool and Clubhouse.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">&nbsp;Mini Gym and Party Hall.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Senior Citizen Sit outs and Tree plazas.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Fully Equipped Kids Play Park</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">24hours Generator Backup for common areas and elevators along with Inverter provisions in all apartments.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Garbage Segregation and composting machines.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Gated Community with 24 Hours Manned security, CCTV Surveillance and Independent Video Door phones.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Mitsubishi/Otis/Schindler make Automatic elevators.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Minimum use of FAR just 50% with larger green areas.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Floor to ceiling heights of 3m.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Piped Gas Systems</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">DTH Provisions in all rooms.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Solar water heating systems.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">Landscaped Gardens and Common Pavered Areas.</span></li>\r\n		</ul>\r\n		<p>\r\n			<span style="font-family:times new roman,times,serif;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;<span style="color: rgb(255, 0, 0);"><strong>The Apartments are being launched at an initial launch price of Rs 62,500/- per sq mts and the same is valid up to November 31st 2013</strong></span></span></p>\r\n		<p>\r\n			<span style="font-family:times new roman,times,serif;"><strong>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<u>NOTE:</u></strong></span></p>\r\n		<ol>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">&nbsp;There will be an initial maintenance deposit of<br />\r\n				&nbsp; 2,50,000 lakhs along with a Parking charge of Rs<br />\r\n				&nbsp; 2,50,000 lakhs.</span></li>\r\n			<li>\r\n				<span style="font-family:times new roman,times,serif;">&nbsp; Every resident will have to compulsorily buy one&nbsp; &nbsp; car park irrespectively. </span></li>\r\n		</ol>\r\n	</body>\r\n</html>\r\n', 'view 2 v3 Email.jpg', 'luxury apartments, 2/ 3 BHK apartments in goa, Spanish styled apartments in North Goa, Apartments in Goa', '8806863388', 491, 1000000, 'Free', '14-11-2013');
