(949, 'info@canaans.in', 'India', 'West Bengal', 'Please Select', '#274, 27th cross, 10th main, Banashankari 2nd stage, Bangalore 560070', 'Real Estate', 'Office-Commercial For Rent', 'Canaans Business Center', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			<strong>Canaans Business Centre</strong> is for people who have established into their own business or are employed and have been looking for an affordable yet modern and accessible office solution.&nbsp;<br />\r\n			<br />\r\n			We therefore decided to setup a small business centre which will provide all the essential business services and amenities to our clients - mainly during the phase when they are setting up and growing. We also help international companies in setting up their India or Bangalore presence.</p>\r\n		<p>\r\n			Canaans Dedicated Office comes with the entire set of facilities and services required to support your business. A Managed office is completely plug and play, and comes with the following features</p>\r\n		<p>\r\n			Why Choose Canaans</p>\r\n		<p>\r\n			&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Prestigious business address in Banashankari</p>\r\n		<p>\r\n			&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; No start up cost/Ready-to-use phones and equipment&nbsp;</p>\r\n		<p>\r\n			&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Receptionist and Welcome Area&nbsp;</p>\r\n		<p>\r\n			&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Daily office cleaning service&nbsp;</p>\r\n		<p>\r\n			&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fully furnished&nbsp;</p>\r\n		<p>\r\n			&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; On-hand consultants</p>\r\n		<p>\r\n			&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; High-speed broadband internet&nbsp;</p>\r\n		<p>\r\n			Meeting Room, Interview Room, Conference Room &amp; Cafeteria (common)</p>\r\n		<p>\r\n			Canaans can assist in expanding your business without the costs of permanent premises. I