(959, 'mearnestfernando@gmail.com', 'India', 'Tamil Nadu', 'Please Select', '', 'Jobs', 'Work From Home', '2014 "TOP RATED" Online Home Business Get started Today-FREE Training', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			Hello Entrepreneurs,</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			SFI (Strong Future International) Marketing Group was launched in 1998. Starting with just one product, sold only in the United States, SFI has now grown to more than 64000 products and services (and growing daily) sold in more than 190 countries around the world.</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			SFI was created to allow anyone with a computer and Internet access the opportunity to tap into the worldwide e-commerce revolution. Anyone of legal age in his or her country can become an SFI affiliate for free by filling out an online registration form. There is no obligation or purchase requirements of any kind.</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			Once registered, affiliates are provided with professional Websites for marketing SFI&#39;s products on the Internet. SFI also provides all necessary sale support services, such as customer service, payment processing, and product shipment &ndash; all at no cost to the affiliate. For each sale generated, SFI pays the referring affiliate a commission. Additional commissions can be earned by building and leading affiliate groups.&nbsp;</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			* Our total Affiliate base increased 242%, we&#39;re now over a half million strong!</div>\r\n		<div>\r\n			* TripleClicks membership mushroomed to nearly 1.9 million members</div>\r\n		<div>\r\n			* Executive Affiliates increased over 400%</div>\r\n		<div>\r\n			* Sales revenues at TripleClicks more than doubled</div>\r\n		<div>\r\n			* Interest in Pricebenders exploded (we&#39;re now seeing nearly 500,000 bids/month)</div>\r\n		<div>\r\n			* SFI Facebook book followers exceeded 70,000</div>\r\n		<div>\r\n			* SFI Twitter followers exceeded 95,000</div>\r\n		<div>\r\n			* Our ECA program reached milestones of 5000 + ECAs in more than 161 countries</div>\r\n		<div>\r\n			* TripleClicks now features more than 109025 products in 27 different categories</div>\r\n		<div>\r\n			* Traffic at TripleClicks has exploded (Alexi.com now lists us as one of the top 2500 most popular sites in the world, up 62% from the start of the year)&nbsp;</div>\r\n		<div>\r\n			* 150,000 Forum Posts!&nbsp;</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			Contact Information</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			SFI&#39;s corporate headquarters is located at: 8251 Northwoods Drive, Suite 200, Lincoln, NE 68505</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			You can reach SFI via phone at 402-434-8480 or via fax at 402-434-8483.</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			Please Check the following URL and register and proceed to learn and earn :-</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			http://www.sfi1.biz/10779237</div>\r\n	</body>\r\n</html>\r\n', 'h_saying.jpg', 'work from home,business opportunity', '9789044802', 575, 1000000, 'Free', '14-01-2014'),
(960, 'yopindore01@gmail.com', 'India', 'Madhya Pradesh', 'Please Select', 'madey pradesh jabalpur', 'Services', 'Other', 'DDS SURVEY FORM FILLING PROCESS', '<html>\r\n	<head>\r\n		<title></title>\r\n	</head>\r\n	<body>\r\n		<p>\r\n			Yop services provide <strong>DDS SURVEY FORM FILLING PROCESS</strong> in India. In DDS Survey form filling process you need to fill up 2500 forms and submit us in 15 days and payout is Rs. 20,000/- Per Assignment, and after that there is quality check of 5 -10 days and then in 48 hours [ 2 days ]&nbsp;&nbsp; your monthly payment should be 20,000 per month, your contract period is for&nbsp; 12 month , and you need to sign SLA service level agreement along with the legal stamp paper&nbsp; with my company, after signing SLA , we will provide you 30 minutes training and after training we will give you the workload, that is 2500 forms and then you can get your payment that is 20,000 INR per month, you need to fill 2500 forms in 15 days and you contract period is for&nbsp; 12 months, .</p>\r\n	</body>\r\n</html>\r\n', '', 'DATA ENTRY PROJECTS, DATA ENTRY SERVICES, DATA ENTRY WORKS', '919424429890', 576, 1000000, 'Free', '14-01-2014'),
